import React, { useEffect, useState } from 'react'
import Header from '../../components/header'
import Club, { instanceOfClub } from '../../entities/club'
import { Error } from '../../entities/error'
import { SaveUserToLocalStorage } from '../../services/firebaseService'
import NetworkService from '../../services/networkService'
import { API_ENDPOINTS } from '../../utils/apiEndpoints'

const SelectClub = () => {
    const [clubs, setClubs] = useState<Club[]>([])
    const fetchClubs = async () => {
        const clubsResponse: Club[] | null | Error = await NetworkService.post({url:API_ENDPOINTS.registerUser})
        if(Array.isArray(clubsResponse) && instanceOfClub(clubsResponse)){
            setClubs(clubsResponse)
        }
    }
    useEffect(() => {
        fetchClubs()
    },[])
    return (
        <>
            <Header pageName='Select Club' />
            <div className='clubs-container container'>
                <p className='page-header'>Choose your club</p>
            </div>
        </>
    )
}

export default SelectClub
